import React, { Fragment } from 'react';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            show: true
        }
    }
    render() {
        return (
            <Fragment>
                <div>Hello</div>
                <button>toggle</button>
            </Fragment>
        );
    }
}

export default App;
